import React from "react";
import ReactDOM from "react-dom";
import { createBrowserHistory } from "history";
import { Router, Route, Switch } from "react-router-dom";

var hist = createBrowserHistory();

ReactDOM.render(
  <Router history={hist}>

  </Router>,
  document.getElementById("root")
);
